import React from "react";

const ModuleList = ({ module, key }) => (
  <li className="list-group-item">
    <a
      key={module.id}
      href={`/courses/${module.courseId}/modules/${
        module.id
      }/lessons/1/topics/1`}
      className="list-group-item"
    >
      {module.title}
    </a>
    <i className="fa fa-trash" />
  </li>
);

export default ModuleList;
